import React from "react";
import WitInfo from "./WitInfo";

function UserProfile() {
  // Example data
  const cohortName = "Cohort Alpha";
  const students = ["Alice", "Bob", "Charlie", "Diana"];

  return (
    <div>
      <h1>User Profile</h1>
      {/* Call WitInfo component */}
      <WitInfo cohortName={cohortName} students={students} />
    </div>
  );
}

export default UserProfile;
